TwoComponent1DConstraintPDF::
TwoComponent1DConstraintPDF(Parameterizable1DPDF* pdfTest, bool fast_mode):
    Parameterizable1DPDF(),
    pdfTest_(pdfTest), fast_mode_(fast_mode)
{
  // nothing to see here
}

TwoComponent1DConstraintPDF::~TwoComponent1DConstraintPDF()
{
  // nothing to see here
}

unsigned TwoComponent1DConstraintPDF::num_parameters()
{
  return 5;
}

std::vector<function::ParameterAxis> TwoComponent1DConstraintPDF::parameters()
{
  constexpr double inf = std::numeric_limits<double>::infinity();
  constexpr double tiny_val = std::numeric_limits<double>::min();
  return { { "probability", "1", true, 0, true, 1 },
	  { "mean_low_gauss", "x-value units", false, -inf, false, inf },
      { "resolution", "1", true, tiny_val, true, 1 },
      { "mean_high_gauss", "x-value units", true, -inf, false, inf },
      { "Width_Ratio", "1", true, tiny_val, true, 1-tiny_val },
       };
}

Eigen::VectorXd TwoComponent1DConstraintPDF::parameter_values()
{
  Eigen::VectorXd pval(5);
  pval << pp_, mu1_, res_, mu2_, n_ ;
  return pval;
}

void TwoComponent1DConstraintPDF::set_parameter_values(ConstVecRef values)
{
  //~ clock_t temps1;
  //~ temps1 = clock();
  verify_set_parameter_values(values, "TwoComponent1DPDF_Constrained");
  assign_parameters(values, pp_, mu1_, res_, mu2_, n_);
  
  const double res = values[2];
  const double pi = M_PI;
  const double Pmax = M_PI*pow(res, 2)/(-2*pow(res, 2) + M_PI*pow(res, 2) - 2 + M_PI);
  if (Pmax >= 1){prob_cpt1_ = pp_;}
  else{
  prob_cpt1_ = pp_ * Pmax;}
  const double p = prob_cpt1_;
  const double mu2 = values[3];
  const double ParamU = ((8*(1-p)*(1-p)*p*p)/pi - 4*(2*p*p/pi - p/(res*res+1))*((1-p)*(1-p)-(1-p)/(res*res+1)));
  const double ParamS = (4*(2*p*p/pi - p/(res*res+1))*(1-p))/(res*res+1);
  const double SigLimit = sqrt(-1*ParamU/ParamS) * mu2;
  double SigLowLimit = 0;
  if ((pow(res, 2) + 1)*(pow(-p + 1, 2) - (-p + 1)/(pow(res, 2) + 1))/(-p + 1) > 0){
    SigLowLimit = sqrt((pow(res, 2) + 1)*(pow(-p + 1, 2) - (-p + 1)/(pow(res, 2) + 1))/(-p + 1))*mu2;
    }
  const double sig2 = SigLowLimit + values[4]*(SigLimit-SigLowLimit);
  
  const double ax = (2./pi)*p*p-p/(res*res+1);	
  const double bx = (sqrt(2./pi)*2*p*(1-p)*mu2);
  const double cx = (1-p)*(1-p)*mu2*mu2 - (1-p)*(sig2*sig2+mu2*mu2)/(res*res+1);	
  const double delta = bx*bx - 4*ax*cx;
  const double solNeg = (sqrt(delta)-bx)/(2*ax);
  //~ const double solPos = (-1)*(bx+sqrt(delta))/(2*ax);
  //~ std::cout << " p " << prob_cpt1_ << std::endl;
  //~ std::cout << " mu1 " << mu1_ << std::endl;
  //~ std::cout << " res " << res_ << std::endl;
  //~ std::cout << " mu2 " << mu2_ << std::endl;
  //~ std::cout << " n " << n_ << std::endl;
  //~ std::cout << " solNeg " << solNeg << std::endl;
  //~ std::cout << " solPos " << solPos << std::endl;
  //~ std::cout << " delta " << delta << std::endl;
  //~ std::cout << " SigLowLimit " << SigLowLimit << std::endl;
  //~ std::cout << " SigLimit " << SigLimit << std::endl;
  //~ std::cout << " ParamU " << ParamU << std::endl;
  //~ std::cout << " ParamS " << ParamS << std::endl;
  //~ std::cout << " Test " << (pow(res, 2) + 1)*(pow(-p + 1, 2) - (-p + 1)/(pow(res, 2) + 1))/(-p + 1) << std::endl;

  Eigen::VectorXd param_2G(5);
  param_2G[0] = prob_cpt1_;
  param_2G[1] = mu1_;
  param_2G[2] = solNeg;
  param_2G[3] = mu2;
  param_2G[4] = sig2;
  pdfTest_->set_parameter_values(param_2G);
  //~ clock_t temps2 = clock();
  //~ std::cout << " set_parameter_values " << (double) (temps2-temps1)/CLOCKS_PER_SEC << std::endl;
}

